  input: TEXT,F3A,,"On June 29, 2001, Constantine Kalogianis and Kalogianis and Associates
    loaned $42,270.49 in securities to Kalogianis for Congress.  The funds were held
    in a securities account and were never liquidated.  Furthermore, the securities
    were not comingled with any other committee funds.  On December 28, 2001, the
    committee securities account transferred its assets  back to Mr. Kalogianis.  During
    the period that the securities were held by the committee, the securities account
    incurred a negative cash balance of $5,685.52.  On January 14, 2002, Mr. Kalogianis
    transerred the same amount from a personal securities account to the committee
    securities account to close the account."
